import React, { Component } from "react";
import { StatusBar } from 'expo-status-bar';
import { TextInput,Alert, Button,StyleSheet, Text, View } from "react-native";
import { LinearGradient } from 'expo-linear-gradient';
import { NavigationContainer, StackActions } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import estilos from './estilos';
import AddAbastecimento from './Componentes/AddAbastecimento';
import ListaAbastecimentos from './Componentes/ListaAbastecimentos'

const Stack = createNativeStackNavigator();

export default function App() {

    return (
      <NavigationContainer>
      <Stack.Navigator initialRouteName="AddAbastecimento">
      <Stack.Screen name="AddAbastecimento" component={AddAbastecimento}/>
          <Stack.Screen name="ListaAbastecimento" component={ListaAbastecimentos}/> 
      </Stack.Navigator>



      </NavigationContainer>
    );
};
